if exists(select * from tempdb..sysobjects where id = object_id('tempdb..#TEMP_LIQUIDACIONES'))
	drop table #TEMP_LIQUIDACIONES

create table #TEMP_LIQUIDACIONES
(
	IdTabla numeric(5) not null identity(1,1),
	NumFondo numeric(6,0),
	CodFondo numeric(5),
	CodTpLiquidacion varchar(2) collate database_default,
	TpoValorCuotaparteAbrev varchar(30),
	CodTpValorCp numeric(3),
	AgColocadorNombre varchar(80),
	CodAgColocador numeric(5),
	SucursalNombre varchar(80),
	CodSucursal numeric(5),
	NumLiquidacion numeric(15),
	CondicionIngEgrDesc varchar(80),
	CodCondicionIngEgr numeric(5),
	NumCuotapartista numeric(15,0),
	CodCuotapartista numeric(10),
	Importe numeric(19,2),
	CantCuotapartes numeric(22,8),
	FechaConcertacion smalldatetime,
	FechaLiquidacion smalldatetime,
	EsRechazo smallint,
	MonedaSimbolo varchar(6),
	CodMoneda numeric(5),
	FactConvMonFdoSol numeric(16,10),
	CodAuditoriaRef numeric(10),
	EstaAnulado smallint,
	SeEmitioInstrPago smallint,
	Reclasifica smallint,
	YaExiste smallint
)

--declare @CodFondo CodigoMedio
--declare @CodMoneda CodigoMedio
--declare @CodAgColocador CodigoMedio
--declare @CodSucursal CodigoMedio

